import React, { PureComponent } from 'react';
import './Stage_Foch.css';
import logo from './Logo_HOPITAL_FOCH.png';

export default function Stage_Foch () { 
        return (
            <>
            &nbsp; {/* non-breaking space */}
            <div className='row'>
            <div className='row'>
                <h3 className="title">Data Science Internship at the Foch Hospital</h3>
                
                <img src={logo} width="150" height="80" />
            </div>
            <div>
                <p>
                Topic: Research of factors (demographic, biological, medicinal, etc.) that can influence hypothermia 
                during a clinical stay.
                </p>
                <p>
                What I did: Data analysis, univariate and multivariate analyses on a database containing 400 variables and 
                10336 observations using the R language.
                </p>
                </div>
                </div>
            </>
        );
    }
